if ($language =~ /^ASCII$/i) {
		$unicodefile = "ASCII_8859-1.TXT";
		$codePage = "cp1252";
		$charsetScript = "charset_auto_generated_ascii.char";
		$delimited = "";
}
elsif ($language =~ /^LATIN1$/i) {
		$unicodefile = "LATIN_8859-1.TXT";
		$codePage = "cp1252";
		$charsetScript = "charset_auto_generated_latin1.char";
}
elsif ($language =~ /^SJIS$/i) {
		$unicodefile = "SJIS_CP932.TXT";
		$codePage = "cp932";
		$charsetScript = "charset_auto_generated_sjis.char";
}
elsif ($language =~ /^GBK|GB2$/i) {
		$unicodefile = "GBK_CP936.TXT";
		$codePage = "cp936";
		$charsetScript = "charset_auto_generated_gb2.char";
}
else {
		print "Wong argument!\nUsage: encode.pl charset\ncharset: ASCII|LATIN1|SJIS|GBK(GB2)";
		exit(0);
}

$identifierSize = 10;
$str = "";
$indexI = 0;
$indexL = 0;

if (-f $unicodefile) {
		open (FILE, $unicodefile) || die "Can not open file ".$unicodefile;
		$i = 0;
		while (<FILE>) {
			if ($_ =~ m/^0x.+\s+(0x....)\s+\S+/s) {
				$str .= chr(hex($1));
				$i++;
			}
		}
		close(FILE);
}

shuffle();
resetIndex();
generate_script();

sub shuffle
{
		my $temp = "";
		my @arr = split(//, $str);
		for ($i = $#arr; $i>0; $i--) {
			$j = int(rand($i));
			$temp = $arr[$i];
			$arr[$i] = $arr[$j];
			$arr[$j] = $temp;
		}
		$str = join('', @arr);
}

sub resetIndex
{
		$indexI = int(rand(length($str)));
		$indexL = int(rand(length($str)));
}

#Return the next Identifer
sub nextI
{
		my($size,$encoded) = @_;
		my $myIdentifier = "";
		$size = $identifierSize if ($size =~ /^$/);

		while (1) {
			$myIdentifier = "";
			if ($language !~ /^ASCII$/i) {
				$myIdentifier = getToken($size, "I");
			}
			else {
				while (length($myIdentifier) < $size) {
					my $aChar = getToken(1, "I");
					next if ($myIdentifier =~ /^$/ and $aChar !~ /^[a-zA-Z]$/);
					$myIdentifier .= $aChar if ($aChar =~ /^[\w\d]$/);
				}
				$myIdentifier = uc($myIdentifier);
			}
			if ($duplicate{$myIdentifier} =~ /^$/) {
				$duplicate{$myIdentifier} = "YES";
				last;
			}
			else {
				shuffle();
			}
		}
		if ($encoded =~ /^no$/i) {
			return $myIdentifier;
		}
		else {
			return encode($codePage, $myIdentifier);
		}
}

#Return the next Literal with size in byte
sub nextLByte
{
		my($literalSize) = @_;
		my $literalByte = getToken($literalSize, "L");
		my $flag = 1;
		my $count = 0;
		while ($flag == 1) {
			$count = length(encode_utf8($literalByte));
			$flag = 0 if ($count <= $literalSize);
			if ($flag == 1) {
				$literalByte =~ s/.$//;
				$indexL--;
			}
		}
		my @arr = (encode($codePage, $literalByte), $count);
		return \@arr;
}

#Return the next Literal in char
sub nextLChar
{
		my($literalSize) = @_;
		my $literalChar = getToken($literalSize, "L");
		my @arr = (encode($codePage, $literalChar), length($literalChar));
		return \@arr;
}

#Get nextToken
sub getToken
{
		my($size,$type) = @_;
		my $token = "";

		my $index = $indexL;
		$index = $indexI if ($type =~ /^I$/);

		if ($index < (length($str) - $size))
		{
			$token = substr $str, $index, $size;
			$index += $size;
		}
		else
		{
			$token = substr $str, $index;
			$index = $size - length($token);
			$token .= substr $str, 0, $index;
		}
		if ($type =~ /^I$/) { #Identifier
			$token =~ s/^[\s+\$]//;
			$token =~ s/\s+$//;
			$token =~ s/[\.\\\/\@\^"]//g; #Hate to use 'double quote' character as identifier
			$indexI = $index;
		}
		else { # Literal
			$token =~ s/'/./g; #Hate to insert 'quote' character as data
			$indexL = $index;
		}
		return $token;
}

#Translate identifiers to wildcards
sub wctranslate
{
		my ($src, $dest, $val) = @_;
		@src_arr = split(//, $src);
		@dest_arr = split(//, $dest);
		@val_arr = split(//, $val);
		my $i = 0;
		foreach my $aChar (@dest_arr) {
			my $temp = $src_arr[$i];
			if (($aChar =~ /^\w$/) && ($aChar =~ /^$temp$/)) {
				$dest_arr[$i] = $val_arr[$i];
			}
			elsif ($aChar =~ /^\.$/) {
				$dest_arr[$i] = "";
			}
			else {
			}
			$i++;
		}
		return encode($codePage, join('',@dest_arr));
}

#Get spaces
sub spaces
{
		my ($sp) = @_;
		my $str = "";
		return $str if ($sp <= 0);
		for (my $i=0; $i<$sp; $i++) {$str .= " ";}
		return $str;
}

